(window.webpackJsonp=window.webpackJsonp||[]).push([[1037],{1392:function(n,h,t){"use strict";t.r(h);var g=t(44),i=Object(g.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-183-tri-lieu-tham-hong"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-183-tri-lieu-tham-hong"}},[n._v("#")]),n._v(" Chương 183: Trị liệu Thẩm Hồng")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("br"),t("br"),n._v(" Ngay ở Lục Tầm, Vương Siêu nghĩ thế nào mượn đến ba trăm vạn, bái kiến “Dương sư” thời điểm, người trong cuộc Trương Huyền, đang cau mày."),t("br"),t("br"),n._v(" Lục Tầm đến đây bái kiến mục đích, ngẫm lại liền có thể rõ ràng, thấy cùng không thấy, đối với hắn mà nói cũng không đáng kể, cũng không để Tôn Cường tận lực gây chuyện."),t("br"),t("br"),n._v(" Giữa hai người chỉ là bình thường sư giả bình trắc, không liên luỵ cừu hận, không cần thiết cố ý gây phiền phức, lại nói, hắn hiện tại không có thời gian cân nhắc cái này, bởi vì... Trước mắt đứng yên một người áo đen."),t("br"),t("br"),n._v(" Cái tên này là theo cổng sau tiến vào, một bộ đồ đen, che khuất dung mạo, để người không nhìn ra là ai, vốn tưởng rằng muốn tới gây phiền phức, ai biết vừa đến trước mặt, lập tức khom người, chậm rãi đem che khuất khuôn mặt miếng vải đen lấy xuống."),t("br"),t("br"),n._v(" “Thẩm Truy bệ hạ, ngươi đây là...” "),t("br"),t("br"),n._v(" Nhìn rõ ràng dung mạo, Trương Huyền sững sờ ở tại chỗ."),t("br"),t("br"),n._v(" Còn tưởng rằng là tên trộm, cường đạo loại hình, không nghĩ tới là hôm qua mới gặp qua Thẩm Truy bệ hạ."),t("br"),t("br"),n._v(" Đường đường quốc vương, toàn bộ Vương quốc đều là của hắn, không quang minh chính đại bái phỏng, một bộ đồ đen lặng lẽ lại đây, chơi thần thần bí bí, đây là muốn làm gì?"),t("br"),t("br"),n._v(" “Ta mạo muội đến đây, là muốn xin Dương sư... Cứu người!” "),t("br"),t("br"),n._v(" Thấy hắn ánh mắt chất vấn, Thẩm Truy bệ hạ vội vàng giải thích."),t("br"),t("br"),n._v(" “Cứu người?” Trương Huyền nghi hoặc."),t("br"),t("br"),n._v(" Một bộ đồ đen, lặng lẽ lẻn vào phủ đệ, này không phải cứu người... Là giết người chứ?"),t("br"),t("br"),n._v(" “Ta không phải đã nói sẽ xuất thủ sao?” "),t("br"),t("br"),n._v(" Hơi nhướng mày, nhìn lại."),t("br"),t("br"),n._v(" Đối phương muốn cứu trị bọn họ lão tổ, ngày hôm qua đã nói, hơn nữa bản thân cũng đưa ra điều kiện, vốn là nói xong rồi, làm sao lúc này chạy tới?"),t("br"),t("br"),n._v(" Lẽ nào cái tên này cảm thấy Thông Huyền cảnh bí tịch không tốt sưu tập, định dùng mạnh?"),t("br"),t("br"),n._v(" Nghĩ tới đây, không nhịn được một trận cảnh giác."),t("br"),t("br"),n._v(" Có thể trở thành là một quốc gia quốc vương, vị này Thẩm Truy bệ hạ thực lực, khẳng định đã sớm đạt đến Thông Huyền cảnh đỉnh phong, tuy rằng hắn gần nhất tiến bộ rất lớn, gặp phải thực lực như vậy cường giả siêu cấp, vẫn như cũ không phải là đối thủ."),t("br"),t("br"),n._v(" Bất quá, ý nghĩ này vừa xuất hiện, liền lập tức lắc lắc đầu."),t("br"),t("br"),n._v(" Trước tiên không nói đối với phương biết mình là “Danh sư” coi như không xác nhận, muốn để cho mình cứu người, cũng không dám làm như vậy."),t("br"),t("br"),n._v(" Vạn nhất bản thân nổi giận không ra tay, hoặc là cố ý tính sai, đừng nói cứu người, e sợ sẽ chết càng nhanh hơn."),t("br"),t("br"),n._v(" “Ta biết mạo muội đến đây tìm Dương sư, là của ta không đúng, vốn nên là chuẩn bị kỹ càng Thông Huyền cảnh bí bản lĩnh lại tới đây mời, ai biết... Lão tổ tình huống tối hôm qua đột nhiên tăng thêm... E sợ, ngày hôm nay đều kiên trì không bất quá đi tới...” "),t("br"),t("br"),n._v(" Thẩm Truy bệ hạ nhìn ra đối phương không vui, sốt ruột vội vàng khom người giải thích: “Vì lẽ đó... Ta không thể làm gì khác hơn là mạo muội đến đây, hi vọng Dương sư có thể đi với ta một chuyến, cứu trị nhà ta lão tổ.” "),t("br"),t("br"),n._v(" “Không kiên trì được? Coi như để ta cứu người... Cũng không đến mức mặc thành như vậy đi...” "),t("br"),t("br"),n._v(" Trương Huyền tràn đầy không nói gì."),t("br"),t("br"),n._v(" Ngươi thế nhưng một quốc gia quốc vương, Thông Huyền cảnh đỉnh phong cường giả, coi như lão tổ sắp chết rồi, muốn cho ta ra tay, cũng không cần thân mặc áo đen, che mặt leo tường đến đây đi."),t("br"),t("br"),n._v(" Chơi cùng muốn giết người giống như, may mà những hộ vệ kia thực lực không cao, không phải vậy, đưa ngươi tại chỗ đánh chết, phỏng chừng cũng là chết vô ích."),t("br"),t("br"),n._v(" “Lão tổ khỏe mạnh là toàn bộ Vương quốc to lớn nhất cơ mật, không thể có mảy may truyền ra ngoài...” Thẩm Truy bệ hạ giải thích."),t("br"),t("br"),n._v(" Thiên Huyền Vương quốc dựa dẫm vị lão tổ này mới có thể có thể bình an, không ít người đều biết thân thể hắn không được, nếu như Thẩm Truy bệ hạ quang minh chính đại phía trước tới mời, những thế lực khác nhận được tin tức, liền có thể đoán ra nguyên nhân, một khi không trị hết, nhất định sẽ rục rà rục rịch, thừa dịp cháy nhà hôi của."),t("br"),t("br"),n._v(" Mà đổi người khác mời, lại không đủ tôn trọng, bất đắc dĩ, đành phải hắn tự mình che khuất thân hình, lặng lẽ lại đây."),t("br"),t("br"),n._v(" Hắn là Thông Huyền cảnh đỉnh phong cường giả, tránh thoát mọi người, tiến vào nơi này, không tính là việc khó."),t("br"),t("br"),n._v(" “Ừm!” Nghe đối phương giải thích xong, Trương Huyền giờ mới hiểu được lại đây: “Tốt, ta đi theo ngươi xem một cái.” "),t("br"),t("br"),n._v(" Xem ra vị này quốc vương bệ hạ, coi chính mình là thành cuối cùng nhánh cỏ cứu mạng."),t("br"),t("br"),n._v(" Bất quá, đối với hắn mà nói không sao cả, ngược lại đều là giao dịch, nếu như thật có thể cứu vị lão tổ kia, Thông Huyền cảnh bí tịch sự tình khẳng định không dám từ chối."),t("br"),t("br"),n._v(" Chỉ cần tìm được hơn một nghìn bản Thông Huyền cảnh bí tịch, sưu tập chính xác câu nói, thực lực khẳng định còn có thể nhanh chóng tăng cường."),t("br"),t("br"),n._v(" “Bên ngoài nhiều người mắt tạp, khả năng còn muốn liên lụy Dương sư theo ta theo cổng sau rời đi...” "),t("br"),t("br"),n._v(" Nghe hắn đáp ứng, Thẩm Truy bệ hạ hưng phấn mắt sáng lên, tiếp theo mang theo áy náy nói."),t("br"),t("br"),n._v(" “Không sao cả!” Trương Huyền gật đầu."),t("br"),t("br"),n._v(" Để người đem Tôn Cường đi tìm đến, bàn giao một tiếng, đi theo Thẩm Truy bệ hạ, lặng lẽ rời đi phủ đệ."),t("br"),t("br"),n._v(" Hô!"),t("br"),t("br"),n._v(" Thiên Huyền Vương thành phòng ốc phía trên, hai bóng người chim giống như xẹt qua, tu vi không đạt tới Đỉnh Lực cảnh, coi như tập trung ánh mắt, cũng chỉ nhìn thấy hai đạo bóng đen, căn bản không thấy rõ đến cùng người nào."),t("br"),t("br"),n._v(" Chính là đi tới Vương cung Trương Huyền cùng Thẩm Truy hai người."),t("br"),t("br"),n._v(" Thân là Thông Huyền cảnh cường giả, lại thêm lên tu luyện võ kỹ không tầm thường, Thẩm Truy tiến lên tốc độ cực nhanh, bất quá, khi thấy phía sau Dương sư, một điểm kiêu ngạo tự tin đều không có."),t("br"),t("br"),n._v(" Một đường tiến lên, hắn thay đổi mười hai loại thân pháp, chạy hư thoát, đầu lưỡi đều sắp nhổ đi ra, mà phía sau Dương sư, lại nhẹ như mây gió, hô hấp không có một chút nào gấp gáp, phảng phất không để ý chút nào."),t("br"),t("br"),n._v(" Tuy rằng không nhìn ra đối phương thực lực chân chính, nhưng chỉ bằng vào điểm ấy, liền có thể nhìn ra đối phương chân khí so với hắn hùng hậu rất nhiều, thân pháp càng là mạnh mẽ không ảnh."),t("br"),t("br"),n._v(" Căn bản không phải đồng nhất cái khái niệm."),t("br"),t("br"),n._v(" Có thể có như thế hùng hậu chân khí cùng tuyệt diệu thân pháp, thực lực lại làm sao có khả năng thấp?"),t("br"),t("br"),n._v(" Khó trách có thể làm cho ba vị danh sư đều khâm phục không thôi, chỉ thực lực như vậy, liền khẳng định vượt qua Thông Huyền cảnh đỉnh phong, làm không cẩn thận... Còn là một vị Tông Sư cảnh cường giả siêu cấp!"),t("br"),t("br"),n._v(" Nghĩ đến điểm này, trong lòng càng thêm kính nể."),t("br"),n._v("  Phía trước Thẩm Truy càng nghĩ càng sợ hãi, mà mặt sau Trương Huyền, nói thật, cũng lòng tràn đầy phiền muộn."),t("br"),t("br"),n._v(" Cái tên này vừa bắt đầu liền dụng hết toàn lực chạy như điên, nếu như theo không kịp, thân phận cũng rất dễ dàng làm lộ, đành phải nhanh muốn thổ huyết cắn răng kiên trì."),t("br"),t("br"),n._v(" Hắn chỉ có Ích Huyệt cảnh đỉnh phong, cứ việc mở ra huyệt đạo tiền vô cổ nhân, sức mạnh có thể so với Thông Huyền cảnh trung kỳ, nhưng cùng đối phương loại này đứng ở Vương quốc đỉnh phong cường giả so, vẫn là chênh lệch thật lớn một đoạn."),t("br"),t("br"),n._v(" May là mấy ngày trước mới vừa học được Thiên Đạo thân pháp, trên tốc độ gia tăng rồi không ít, bằng không, đừng nói đuổi tới, e sợ một cái thất thần, liền biến mất không thấy hình bóng, trơ mắt ăn đất."),t("br"),t("br"),n._v(" Dù vậy, cũng có đến vài lần suýt chút nữa bị quăng đi, đành phải vận dụng Thiên Đạo thư viện, tìm ra đối phương thân pháp thiếu hụt cùng thói quen, sớm làm ra dự phán, đi càng gần hơn khoảng cách, lúc này mới sa sút ở phía sau."),t("br"),t("br"),n._v(" “May mà hắn thân pháp thiếu hụt nhiều, bằng không, thật bị quăng đi, cao nhân cũng không cần trang...” "),t("br"),t("br"),n._v(" Đối phương cực tốc tiến lên, thứ nhất, vương thất lão tổ tình huống khẳng định không lạc quan, trong lòng sốt ruột; Thứ hai, khẳng định mang theo thăm dò mùi vị, thực sự là lợi hại danh sư, tốc độ tự nhiên thực sự nhanh hơn nhiều, coi như dụng hết toàn lực cũng không tính là gì, theo không kịp, coi như vị này Thẩm Truy bệ hạ không dám làm mặt nói ra, cũng tất nhiên trong lòng hoài nghi."),t("br"),t("br"),n._v(" Chính là bởi vì rõ ràng điểm ấy, mới cảm thấy phiền muộn."),t("br"),t("br"),n._v(" Chuyện này là sao, nói là đi cứu người, kết quả thành sức kéo thi đấu, muốn liều mạng truy đuổi mới được, nếu không là kiêng kỵ “Cao nhân” hình tượng, sợ là sớm đã một chân đạp đi qua."),t("br"),t("br"),n._v(" Đây là xin hắn hỗ trợ vẫn là xin hắn thi chạy..."),t("br"),t("br"),n._v(" Then chốt dụng hết toàn lực truy đuổi, vẫn chưa thể mảy may lộ ra mệt mỏi tâm ý, nếu không là mấy ngày nay vừa mới đột phá, chân khí trong cơ thể phát động, e sợ thật liền lộ ra sơ sót."),t("br"),t("br"),n._v(" Ma đản, trang cái cao nhân, cũng như thế không dễ dàng, thật hắn mẹ không phải người kiếm sống."),t("br"),t("br"),n._v(" Ý nghĩ này nếu như cho Tôn Cường biết, khẳng định rất là tán thành, hắn liền bởi vì trang một hồi cao nhân, suýt chút nữa đem mình trang chết... Bây giờ lòng vẫn còn sợ hãi, muốn thổ huyết."),t("br"),t("br"),n._v(" “Triệu Nhã các nàng đồ vật đến, cùng Thông Huyền cảnh bí tịch tìm tới, liền để vị này ‘Dương Huyền’ rời đi...” "),t("br"),t("br"),n._v(" Trong lòng âm thầm quyết định."),t("br"),t("br"),n._v(" Tuy rằng ngụy trang thành danh sư được người ta tôn trọng, địa vị tôn sùng, nhưng phiền phức cũng nhiều, một khi bị người nhìn thấu, bị đánh chết tươi đều là nhẹ."),t("br"),t("br"),n._v(" Bây giờ nhìn lại, Thẩm Truy bệ hạ tìm tới bí tịch, liền để vị này “Dương Huyền danh sư” biến mất."),t("br"),t("br"),n._v(" Một đường tiến lên, sau mười mấy phút, Vương cung đi tới trước mắt."),t("br"),t("br"),n._v(" Xem ra là sớm giao phó xong, một đường tiến lên vẫn chưa gặp phải mảy may ngăn cản, thời gian không lâu, nhìn thấy một cái rộng rãi đại sảnh."),t("br"),t("br"),n._v(" “Đang ở bên trong...” Thẩm Truy bệ hạ đẩy cửa đi vào."),t("br"),t("br"),n._v(" Bên trong đại sảnh, Lưu sư, Trang sư bọn người tại, từng cái từng cái nhíu mày thành mụn nhọt, nhìn về phía cách đó không xa nằm một ông già."),t("br"),t("br"),n._v(" Thiên Huyền Vương quốc nền tảng, Thẩm Hồng."),t("br"),t("br"),n._v(" Mấy ngày trước vừa tới thời điểm, vị này lão giả râu tóc bạc trắng, còn có thể độc lập cất bước, mà hiện tại, chỉ có thể nằm ở trên giường, một hơi nhiều, một hơi ít, nhìn dáng dấp bất cứ lúc nào cũng sẽ tử vong."),t("br"),t("br"),n._v(" “Dương sư!” "),t("br"),t("br"),n._v(" Thấy bọn họ đi vào, Lưu Lăng mấy người tiến lên đón."),t("br"),t("br"),n._v(" Đi qua lần trước bái phỏng, biết trước mắt vị này Dương sư, khả năng là so với bọn họ cấp bậc cao hơn nữa danh sư, ba người không dám mảy may bất cẩn."),t("br"),t("br"),n._v(" “Kính xin Dương sư ra tay...” Thẩm Truy bệ hạ nhìn sang, một mặt sốt ruột."),t("br"),t("br"),n._v(" “Có thể cứu, ta nhất định sẽ ra tay.” "),t("br"),t("br"),n._v(" Trương Huyền đáp một tiếng, đi tới ông lão trước mặt."),t("br"),t("br"),n._v(" Trước mắt Thẩm Hồng, so với phía trước nhìn thấy Trần Tiêu đan sư tử khí còn nặng hơn, bình nằm ở trên giường, không thể động đậy một chút nào, nếu không là con ngươi động đậy, cũng hoài nghi có phải là đã chết rồi."),t("br"),t("br"),n._v(" Khó trách Thẩm Truy bệ hạ chuyên môn chạy qua tìm đến mình, hiện tại tình huống như thế, không mau nhanh cứu trị, có thể hay không sống quá ngày hôm nay, đều còn khó nói."),t("br"),t("br"),n._v(" Dọc theo quay một vòng, không nhìn ra nguyên cớ đến, Trương Huyền đành phải đưa ngón tay gác lên đối phương mạch đập bên trên."),t("br"),t("br"),n._v(" “Hả?” "),t("br"),t("br"),n._v(" Thiên Đạo thư viện không có động tĩnh chút nào."),t("br"),t("br"),n._v(" Không phải thủ pháp sai rồi, mà là... Cái này Thẩm Hồng vẫn chưa hôn mê, hắn hiện tại con ngươi còn năng động, là tỉnh..."),t("br"),t("br"),n._v(" “Bộ dáng này, để hắn lên đánh quyền, không quá hiện thực...” "),t("br"),t("br"),n._v(" Trương Huyền sắc mặt khó coi."),t("br"),t("br"),n._v(" Cái tên này hiện tại dáng vẻ ấy, đừng nói đánh quyền, có thể mở mắt là tốt lắm rồi, vạn nhất cưỡng chế đánh quyền, e sợ còn không ra tay, liền trực tiếp chết ở trước mặt."),t("br"),t("br"),n._v(" “Dương sư... Có thể có cứu trị phương pháp?” "),t("br"),t("br"),n._v(" Thấy hắn cau mày, Thẩm Truy bệ hạ có chút không nhịn được, sốt sắng hỏi."),t("br"),t("br"),n._v(" Này đã là hy vọng cuối cùng, nếu như lại hết cách rồi, cũng chỉ có thể trơ mắt nhìn lão tổ tử vong."),t("br"),t("br"),n._v(" “Cái này...” Trương Huyền vò đầu."),t("br"),t("br"),n._v(" Cũng không thể nói cái gì ngoạn ý không nhìn ra đi..."),t("br"),t("br"),n._v(" Có ý thức người đánh quyền, hôn mê chạm đến, hai thứ này đều chuyên môn từng thử, cũng có thể làm cho thư viện sinh thành thư tịch, có thể... Loại này sống dở chết dở làm sao làm?"),t("br"),t("br"),n._v(" Quyền không thể đánh, chạm đến lại không phản ứng..."),t("br"),t("br"),n._v(" Xấu tốt ngất một hồi cũng được a, rõ ràng đều sắp không mở mắt nổi, còn không hôn mê muốn làm gì!"),t("br"),t("br"),n._v(" “Khặc khặc...” "),t("br"),t("br"),n._v(" Băn khoăn chốc lát, Trương Huyền chần chờ một chút, ngẩng đầu nhìn lại đây: “Cái này... Ngươi nơi này có món đồ gì, có thể khiến người ta nhanh chóng hôn mê, lại... Sẽ không chết?” "),t("br"),t("br"),n._v("Convert by: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-191"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-193"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=i.exports}}]);